Ext.data.JsonP['Mobile_Backend_Services_FAQ']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Mobile Backend Services FAQ</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-51250815\" class=\"content\">\n                        <h1>Mobile Backend Services FAQ</h1>\n    <p>This document provides questions and answer for several frequently asked questions about MBS.    </p>\n    <p>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Mobile_Backend_Services_FAQ-section-src-51250815_MobileBackendServicesFAQ-FirebasepushnotificationusingAppcelerator\">Firebase push notification using Appcelerator</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Mobile_Backend_Services_FAQ-section-src-51250815_MobileBackendServicesFAQ-SendingpushviaFirebaseAPIkey\">Sending push via Firebase API key</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Mobile_Backend_Services_FAQ-section-src-51250815_safe-id-TW9iaWxlQmFja2VuZFNlcnZpY2VzRkFRLUlzR0NNZ29pbmd0b2JlZGVwcmVjYXRlZD8\">Is GCM going to be deprecated?</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Mobile_Backend_Services_FAQ-section-src-51250815_MobileBackendServicesFAQ-Pushnotificationsamplecode\">Push notification sample code</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Mobile_Backend_Services_FAQ-section-src-51250815_MobileBackendServicesFAQ-ErrorenablingCloudserviceforproject\">Error enabling Cloud service for project</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Mobile_Backend_Services_FAQ-section-src-51250815_MobileBackendServicesFAQ-Pushnotificationerrormessages\">Push notification error messages</a>    </p>\n</li></ul>    <div class=\"section section-2 \" id=\"src-51250815_MobileBackendServicesFAQ-FirebasepushnotificationusingAppcelerator\">\n        <h2 class=\"heading \"><span>Firebase push notification using Appcelerator</span></h2>\n    <p>Firebase Cloud Messaging (FCM) is the new version of <strong class=\" \">GCM. </strong>Please visit <a class=\"external-link external-link\" href=\"https://console.firebase.google.com/\" target=\"_blank\">https://console.firebase.google.com</a>.    </p>\n    <p>Then create your project and use that Project ID and Web API Key as a GCM sender ID and GCM API key.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51250815_MobileBackendServicesFAQ-SendingpushviaFirebaseAPIkey\">\n        <h2 class=\"heading \"><span>Sending push via Firebase API key</span></h2>\n    <p>You can import a cloud-enable project into Firebase. Basically similar, the end result will be a new key is generated. The steps for this are:    </p>\n<ol class=\" \"><li class=\" \">    <p>Log into Firebase console: <a class=\"external-link external-link\" href=\"https://console.firebase.google.com/\" target=\"_blank\">https://console.firebase.google.com/</a>    </p>\n</li><li class=\" \">    <p>Choose <strong class=\" \">Import Google Project</strong> from the project menu.    </p>\n</li><li class=\" \">    <p>Select <strong class=\" \">Project Settings</strong> from the gear menu    </p>\n</li><li class=\" \">    <p>Select the <strong class=\" \">CLOUD MESSAGING Tab</strong> and use the server key and sender ID.    </p>\n</li><li class=\" \">    <p>Configuring push service on the Dashboard by reviewing the information in <a class=\"document-link \" href=\"#!/guide/Configuring_push_services\">Configuring push services</a>.    </p>\n</li></ol>    <p><a class=\"external-link external-link\" href=\"https://gist.github.com/MotiurRahman/2cd4520727271bb60316d57032bf0028\" target=\"_blank\">https://gist.github.com/MotiurRahman/2cd4520727271bb60316d57032bf0028</a> provides an sample app.    </p>\n    <div class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n            <p>Make sure your Appcelerator ID and package name is same.    </p>\n    </div>\n        <p>Further reading: <a class=\"external-link external-link\" href=\"https://documentation.onesignal.com/docs/generate-a-google-server-api-key\" target=\"_blank\">Generate a Google Server API Key</a>    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51250815_safe-id-TW9iaWxlQmFja2VuZFNlcnZpY2VzRkFRLUlzR0NNZ29pbmd0b2JlZGVwcmVjYXRlZD8\">\n        <h2 class=\"heading \"><span>Is GCM going to be deprecated?</span></h2>\n    <p>We will continue to support the current version of GCM Android and iOS SDKs because we know a lot of developers are using GCM SDKs today to handle notifications and client app upgrade takes time.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51250815_MobileBackendServicesFAQ-Pushnotificationsamplecode\">\n        <h2 class=\"heading \"><span>Push notification sample code</span></h2>\n    <p>Appcelerator provided subscribed device token code with iOS 10 or later devices have some problem but part it doesn&apos;t work anymore: <tt class=\" \">Ti.Platform.name == &quot;iPhone OS&quot;</tt>    </p>\n    <p>Visit <a class=\"external-link external-link\" href=\"https://gist.github.com/MotiurRahman/2cd4520727271bb60316d57032bf0028\" target=\"_blank\">https://gist.github.com/MotiurRahman/2cd4520727271bb60316d57032bf0028</a> for a working sample.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51250815_MobileBackendServicesFAQ-ErrorenablingCloudserviceforproject\">\n        <h2 class=\"heading \"><span>Error enabling Cloud service for project</span></h2>\n    <p>If you receive a message similar to &quot;Error enabling Cloud service for project&quot; in Studio when trying to enable Cloud services for your project, the Mobile Backend Services (MBS) server may be down or Studio is unable to connect to the MBS server. Try to enable Cloud services later.    </p>\n    <p>See <a class=\"document-link \" href=\"#!/guide/Troubleshooting_Guide-section-src-49153865_TroubleshootingGuide-ErrorenablingCloudserviceforproject\">Troubleshooting Guide</a> for more details.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51250815_MobileBackendServicesFAQ-Pushnotificationerrormessages\">\n        <h2 class=\"heading \"><span>Push notification error messages</span></h2>\n    <p>Apple Push and Google Cloud Messaging provide error codes for common push notification errors. See <a class=\"document-link \" href=\"#!/guide/Troubleshooting_Guide-section-src-49153865_safe-id-VHJvdWJsZXNob290aW5nR3VpZGUtQXBwbGVQdXNoTm90aWZpY2F0aW9uU2VydmVyKEFQTlMpZXJyb3Jz\">Apple Push Notification Server errors</a> and <a class=\"document-link \" href=\"#!/guide/Troubleshooting_Guide-section-src-49153865_safe-id-VHJvdWJsZXNob290aW5nR3VpZGUtR29vZ2xlQ2xvdWRNZXNzYWdpbmcoR0NNKWVycm9ycw\">Google Cloud Messaging errors</a> for more details.    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=51250815\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Mobile Backend Services FAQ"});